typedef enum {
	GPIO_INPUT,
	GPIO_OUTPUT,
	GPIO_ALTERNATE_FUNCTION,
	GPIO_ANALOG
} GPIO_PORT_MODES;

typedef enum {
	GPIO_PUSHPULL,
	GPIO_OPENDRAIN
} GPIO_OUTPUT_TYPE;

typedef enum {
	GPIO_LOW_SPEED,
	GPIO_MEDIUM_SPEED,
	GPIO_HIGH_SPEED,
	GPIO_VERY_HIGH_SPEED
} GPIO_OP_SPEED;

typedef enum {
	GPIO_NO_PUPD,
	GPIO_PULL_UP,
	GPIO_PULL_DOWN
} GPIO_PUPDR;

typedef enum {
    RCC_GPIOA,
    RCC_GPIOB,
    RCC_GPIOC,
    RCC_GPIOD,
    RCC_GPIOE,
    RCC_GPIOF,
    RCC_GPIOG,
    RCC_GPIOH,
    RCC_GPIOI,
    RCC_GPIOJ,
    RCC_GPIOK
} GPIO_PORTS;

